-- Could not upload the files like in the video. I used Power Query in Excel to keep only 1,000 rows as SSMS CREATE TABLE statement only takes 1,000 rows. Location was filtered to only USA

CREATE TABLE CovidDeaths 
(
    iso_code VARCHAR(512),
    continent VARCHAR(512),
    location VARCHAR(512),
    date DATE,
    population INT,
    total_cases INT,
    new_cases INT,
    new_cases_smoothed FLOAT,
    total_deaths INT,
    new_deaths INT,
    new_deaths_smoothed FLOAT,
    total_cases_per_million FLOAT,
    new_cases_per_million FLOAT,
    new_cases_smoothed_per_million FLOAT,
    total_deaths_per_million FLOAT,
    new_deaths_per_million FLOAT,
    new_deaths_smoothed_per_million FLOAT,
    reproduction_rate FLOAT,
    icu_patients INT,
    icu_patients_per_million FLOAT,
    hosp_patients INT,
    hosp_patients_per_million FLOAT,
    weekly_icu_admissions VARCHAR(512),
    weekly_icu_admissions_per_million VARCHAR(512),
    weekly_hosp_admissions INT,
    weekly_hosp_admissions_per_million FLOAT
);

  
  CREATE TABLE CovidVaccinations 
(
    iso_code VARCHAR(512),
    continent VARCHAR(512),
    location VARCHAR(512),
    date DATE,
    total_tests INT,
    new_tests INT,
    total_tests_per_thousand FLOAT,
    new_tests_per_thousand FLOAT,
    new_tests_smoothed INT,
    new_tests_smoothed_per_thousand FLOAT,
    positive_rate FLOAT,
    tests_per_case FLOAT,
    tests_units VARCHAR(512),
    total_vaccinations VARCHAR(512),
    people_vaccinated VARCHAR(512),
    people_fully_vaccinated VARCHAR(512),
    total_boosters VARCHAR(512),
    new_vaccinations VARCHAR(512),
    new_vaccinations_smoothed VARCHAR(512),
    total_vaccinations_per_hundred FLOAT,
    people_vaccinated_per_hundred FLOAT,
    people_fully_vaccinated_per_hundred FLOAT,
    total_boosters_per_hundred FLOAT,
    new_vaccinations_smoothed_per_million VARCHAR(512),
    new_people_vaccinated_smoothed VARCHAR(512),
    new_people_vaccinated_smoothed_per_hundred VARCHAR(512),
    stringency_index FLOAT,
    population_density FLOAT,
    median_age FLOAT,
    aged_65_older FLOAT,
    aged_70_older FLOAT,
    gdp_per_capita FLOAT,
    extreme_poverty FLOAT,
    cardiovasc_death_rate FLOAT,
    diabetes_prevalence FLOAT,
    female_smokers FLOAT,
    male_smokers FLOAT,
    handwashing_facilities VARCHAR(512),
    hospital_beds_per_thousand FLOAT,
    life_expectancy FLOAT,
    human_development_index FLOAT,
    excess_mortality_cumulative_absolute VARCHAR(512),
    excess_mortality_cumulative VARCHAR(512),
    excess_mortality VARCHAR(512),
    excess_mortality_cumulative_per_million VARCHAR(512)
);


